(76, 'Klettern', 'Die Fertigkeit Klettern umfasst das Freiklettern, bei dem\r\nAbenteurer ohne Hilfsmittel senkrechte Mauern, steile Fels-\r\nwände und glatte Baumstämme erklimmen, aber auch das\r\nBergsteigen, wobei Seilschaften schwierige Stellen am Berg\r\nüberwinden. Für einfache Klettervorgänge wie dem Erklim-\r\nmen eines astreichen Baumes, bei denen Hände und Füße\r\nausreichend Halt ﬁnden, braucht die Fertigkeit nicht einge-\r\nsetzt zu werden. Auch beim Hochklettern an einem Seil ist\r\nkein Erfolgswurf nötig; hierfür reicht ein PW–30:Stärke aus.\r\nBeim Einsatz von Klettern muss ein Abenteurer beide Hände\r\nfrei haben. Jede Runde (alle 10 sec), die ein Freikletterer in\r\neiner Wand unterwegs ist, muss er einen EW:Klettern ma-\r\nchen. Gelingt ihm ein kritischer Erfolg, legt er die doppelte\r\nStrecke zurück. Scheitert der Wurf auf normale Weise, ent-\r\nscheidet ein zweiter EW:Klettern über die Folgen. Gelingt\r\nder Wurf, hat der Abenteurer rechtzeitig gemerkt, dass er ab-\r\nzustürzen droht. Er kommt dann nicht voran und verbringt die\r\n\r\nRunde damit, wieder sicheren Halt zu erlangen. Misslingt der\r\nzweite Erfolgswurf oder war schon der erste Wurf ein kri-\r\ntischer Fehler, rutscht der Abenteurer ab und stürzt. Bietet\r\ndie Wand ausreichend Griﬀmöglichkeiten oder gar Simse,\r\nauf denen man stehen kann, hat der Fallende noch mit einem\r\nPW:Gw/2 die Möglichkeit, 1W3 m tiefer einen Halt zu ﬁn-\r\nden und seinen Sturz zu bremsen. Er verliert dann nur 1W6\r\nAP. Sonst fällt er die ganze Strecke bis zum Boden hinunter.\r\nBei der Bestimmung der Fallhöhe wird davon ausgegangen,\r\ndass ein abstürzender Kletterer seinen Halt kurz nach Beginn\r\nder laufenden Runde verliert, d.h. er stürzt aus der Höhe ab,\r\ndie er bei Rundenbeginn erreicht hat. Den Sturzschaden lie-\r\nfert Tabelle 2 (s. S. 62).\r\nAbenteurer, die die Fertigkeit Klettern beherrschen, können\r\nsich mit geeigneter Ausrüstung vor Stürzen sichern, indem\r\nsie etwa alle drei Meter Haken in die Wand schlagen und\r\nsich daran anseilen. Droht ein Kletterer, der sich gesichert\r\nhat, abzustürzen, führt er einen dritten EW:Klettern aus. Nur\r\nwenn dieser ebenfalls misslingt, stürzt der Abenteurer in die\r\nTiefe, da dann die Sicherung fehlerhaft ist und ihn nicht hält.\r\nBei diesem dritten Erfolgswurf wird die Schwierigkeit der\r\nWand nicht berücksichtigt. Das Hineinschlagen eines Hakens\r\nSchwierigkeit beim Einsatz von Klettern\r\nsehr leicht (+4)\r\nWand ist stark vom Kletterer weg geneigt (etwa 60\r\nGrad Neigung)\r\nWand hat viele Griﬀmöglichkeiten und Simse zum Ste-\r\nhen\r\nleicht (+2)\r\nWand ist etwas vom Kletterer weg geneigt (etwa 75\r\nGrad Neigung)\r\nWand hat gute Griﬀmöglichkeiten\r\nschwer (–2)\r\nWand ist sehr glatt, nass oder nach innen geneigt\r\nsehr schwer (–4)\r\nWand ist sehr glatt und nass\r\nWandﬂäche ist rutschig\r\nAbenteurer trägt Platten- oder Vollrüstung oder schwere\r\nLast (s. Tabelle 1)\r\nbesonders schwer (–6)\r\nWand ist sehr glatt und nach innen geneigt\r\näußerst schwer (–8)\r\nWand ist sehr glatt und rutschig in eine Wand dauert 1 min, verursacht Lärm und hinterlässt\r\ndeutliche Spuren.\r\nDer Normalfall beim Freiklettern ist das Ersteigen einer senk-\r\nrechten trockenen Wand mit einigen Ritzen und kleinen Spal-\r\nten, in denen der Kletterer Halt ﬁnden kann. Beispiele sind\r\neine Hausmauer aus grob behauenen Steinblöcken oder ein\r\nBaumstamm mit einer rissigen Borke. Dabei legt der Klette-\r\nrer 3 m pro Runde (10 sec) zurück. Bei schwierigeren oder\r\nleichteren Herausforderungen kann der Spielleiter die Klet-\r\ntergeschwindigkeit entsprechend anpassen.\r\nGlattere oder nasse Wände erschweren das Klettern, wäh-\r\nrend zusätzliche Griﬀmöglichkeiten die Erfolgsaussichten\r\nverbessern. Die Neigung einer Wand spielt ebenfalls eine\r\nRolle; überhängende Wände haben einen hohen Schwierig-\r\nkeitsgrad, während vom Kletterer weg geneigte Steilhänge\r\nihm das Vorankommen erleichtern. Hänge, die höchstens 45\r\nGrad geneigt sind, können auch ohne Einsatz von Klettern\r\nüberwunden werden (s. auch Balancieren, S. 104)', 'KOD5 115', 'St', 12, 1, 0, 'Alltag', 'midgard', 'leicht', NULL, NULL);
